import React from 'react';

function MyInfo() {
    return (
        <div>
        <header>Jihun Park</header>
        <p>My name is Jihun Park. I am 28 and I am from Seoul. I like food, money and electronics</p>
        <ul>List of favorite vacation spots
        <li>Las Vegas</li>
        <li>Los Angeles</li>
        <li>Seoul</li></ul>
        </div>
      )
}

export default MyInfo;
